    rdfs:subClassOf <http://data.ashrae.org/standard223#Sensor> ;
    sh:property [ rdfs:comment "A `TemperatureSensor` shall always observe a `QuantifiableObservableProperty` that has a `QuantityKind` of `Temperature`." ;
