    rdfs:label "paired connection point" ;
    rdfs:comment "The `pairedConnectionPoint` relation is a symmetric relation used to associate two connection points where an `InletConnectionPoint` shares the same medium with an `OutletConnectionPoint`." .

http://data.ashrae.org/standard223#mapsT.cbd:
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

