        rdf:Property ;
    rdfs:label "mapsTo" ;
    rdfs:comment "The relation `mapsTo` is used to associate a `ConnectionPoint` of a `Connectable` to a corresponding `ConnectionPoint` of the one containing it (see {pub:equipment-containment}). The associated connection points must have the same direction (see {s223:EnumerationKind-Direction}) and compatible medium (see {s223:Substance-Medium})." .

http://data.ashrae.org/standard223#hasMe.cbd:
