http://data.ashrae.org/standard223#Condu.cbd:
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix sh: <http://www.w3.org/ns/shacl#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

<http://data.ashrae.org/standard223#Conductor> a <http://data.ashrae.org/standard223#Class>,
        sh:NodeShape ;
    rdfs:label "Conductor" ;
    rdfs:comment """A `Conductor` is a subclass of `Connection`. It is an abstraction that represents one or more wires used to convey electricity, 
with the electricity conceptualized as flowing through a `Conductor` like water through a pipe. Each instance of `Conductor` applies to no more than one circuit.""" ;
    rdfs:subClassOf <http://data.ashrae.org/standard223#Connection> ;
    sh:property [ rdfs:comment "Ensure the electrical phase is the same as all connected `ConnectionPoint`s" ;
            sh:path <http://data.ashrae.org/standard223#hasElectricalPhase> ;
            sh:sparql [ a sh:SPARQLConstraint ;
                    rdfs:comment "Ensure the electrical phase is the same as all connected `ConnectionPoint`s" ;
                    sh:message "s223: {$this} has an electrical phase of {?myphase} which is different from {?cpPhase} for `ConnectionPoint` {?cp}." ;
                    sh:prefixes <http://data.ashrae.org/standard223/1.0/validation/model> ;
                    sh:select """
    SELECT $this ?myphase ?cp ?cpPhase
    WHERE {
        $this s223:hasElectricalPhase ?myphase .
        $this s223:connectsAt ?cp .
        ?cp s223:hasElectricalPhase ?cpPhase .
        FILTER (?myphase != ?cpPhase) .
        }
        """ ] ],
        [ rdfs:comment "If the relation `hasElectricalPhase` is present it must associate the `Conductor` with a single ElectricalPhaseIdentifier or ElectricalVoltagePhases value." ;
            sh:maxCount 1 ;
            sh:message "s223: If the relation `hasElectricalPhase` is present it must associate the `Conductor` with a single ElectricalPhaseIdentifier or ElectricalVoltagePhases value." ;
            sh:or ( [ sh:class <http://data.ashrae.org/standard223#EnumerationKind-ElectricalPhaseIdentifier> ] [ sh:class <http://data.ashrae.org/standard223#EnumerationKind-ElectricalVoltagePhases> ] ) ;
            sh:path <http://data.ashrae.org/standard223#hasElectricalPhase> ],
        [ rdfs:comment "A `Conductor` must be associated with exactly one `Constituent-Electricity` using the relation `hasMedium`." ;
            sh:class <http://data.ashrae.org/standard223#Constituent-Electricity> ;
            sh:maxCount 1 ;
            sh:message "s223: A `Conductor` must be associated with exactly one `Constituent-Electricity` using the relation `hasMedium`." ;
            sh:minCount 1 ;
            sh:path <http://data.ashrae.org/standard223#hasMedium> ] ;
    sh:rule [ a sh:TripleRule ;
            rdfs:comment "Infer the `hasElectricalPhase` value from any connected `ConnectionPoint`s." ;
            sh:object [ sh:path ( <http://data.ashrae.org/standard223#cnx> <http://data.ashrae.org/standard223#hasElectricalPhase> ) ] ;
            sh:predicate <http://data.ashrae.org/standard223#hasElectricalPhase> ;
            sh:subject sh:this ] .

